INSERT INTO project (proj_create_date, proj_end_date, proj_no, proj_percent, proj_start_date, projp_no, projs_no, proj_pm, proj_title, proj_desc) VALUES ('2024-03-22', '2024-05-08', 1, 22, '2024-03-22', 'LV0', 'TODO', 8, '장바구니 결제 로직 변경 요청 건', '안녕하세요. 저희는 최근에 장바구니 결제 로직을 변경하고자 합니다. 변경된 로직은 사용자 경험을 개선하고 결제 과정을 보다 간편하게 만들어줄 것입니다. 변경된 결제 로직은 사용자가 장바구니에 담은 상품을 확인하고 신속하게 결제할 수 있도록 도와줄 것입니다. 또한 보안과 안정성에 대한 고려도 함께 고려되었습니다. 이에 대한 자세한 내용은 저희와 함께 상의해 보겠습니다. 추가적인 문의나 의견이 있으시다면 언제든지 연락주시기 바랍니다. 감사합니다.');
INSERT INTO project (proj_create_date, proj_end_date, proj_no, proj_percent, proj_start_date, projp_no, projs_no, proj_pm, proj_title, proj_desc) VALUES ('2024-02-22', '2024-02-25', 2, 100, '2024-02-22', 'LV1', 'DONE', 3, '게시판 UI 수정요청건', '웹 애플리케이션의 사용자 인터페이스(UI)를 개선하여 사용자 경험을 향상시키는 프로젝트입니다.');
INSERT INTO project (proj_create_date, proj_end_date, proj_no, proj_percent, proj_start_date, projp_no, projs_no, proj_pm, proj_title, proj_desc) VALUES ('2024-03-22', '2024-04-02', 3, 30, '2024-03-17', 'LV2', 'DOING', 15, '데이터 마이그레이션', '기존 데이터베이스를 새로운 시스템으로 마이그레이션하는');
INSERT INTO project (proj_create_date, proj_end_date, proj_no, proj_percent, proj_start_date, projp_no, projs_no, proj_pm, proj_title, proj_desc) VALUES ('2024-01-03', '2024-04-07', 4, 70, '2024-03-12', 'LV3', 'HOLD', 13, '온라인 마켓플레이스 확장 프로젝트', '온라인 마켓플레이스의 기능을 확장하여 새로운 상품 카테고리를 추가하는 프로젝트');
INSERT INTO project (proj_create_date, proj_end_date, proj_no, proj_percent, proj_start_date, projp_no, projs_no, proj_pm, proj_title, proj_desc) VALUES ('2024-03-04', '2024-05-14', 5, 0, '2024-03-29', 'LV0', 'TODO', 24, '보안 강화 및 취약점 점검 프로젝트', '시스템의 보안성을 강화하고 취약점을 점검하여 보안 위협으로부터 시스템을 보호하는 프로젝트입니다.');
INSERT INTO project (proj_create_date, proj_end_date, proj_no, proj_percent, proj_start_date, projp_no, projs_no, proj_pm, proj_title, proj_desc) VALUES ('2024-03-15', '2024-04-27', 6, 20, '2024-03-15', 'LV3', 'DOING', 24, '8390서버 이관작업 요청', '기존 서버 인프라를 새로운 환경으로 안전하게 이관하여 안정성과 성능을 향상시키기 위한 작업입니다. 서버 이관 작업 중에는 업무 중단이 최소화되도록 주의하며, 데이터의 무결성과 보안을 최우선으로 고려하여 이관 작업을 수행합니다.');
INSERT INTO project (proj_create_date, proj_end_date, proj_no, proj_percent, proj_start_date, projp_no, projs_no, proj_pm, proj_title, proj_desc) VALUES ('2024-03-22', '2024-04-09', 7, 0, '2024-04-01', 'LV2', 'TODO', 74, '해외 마케팅 전략 회의', '해외 시장에서의 경쟁이 치열해지고 있는 가운데, 우리 기업의 제품과 서비스를 성공적으로 홍보하고 글로벌 시장에서 선점하기 위해 해외 마케팅 전략 수립이 필요합니다-이 프로젝트는 다양한 해외 시장에서 소비자들의 관심을 끌고 매출을 증대하기 위한 전략을 개발하고 실행하는 것을 목표로 합니다.');
